import React, { Component } from "react";
import { connect } from "react-redux";

export class DriverProfileG extends Component {
  render() {
    console.log(this.props);
    const { drivers } = this.props;
    const driverList = drivers.length ? (
      drivers.map(driver => {
        return (
          <div>
            <div
              className="row"
              style={{ backgroundColor: "light-blue accent-1" }}
            >
              <div className="col s12 z-depth-1">
                <span className="flow-text"> DRIVERS > {driver.id}</span>
              </div>
              <br />
              <br />
              <br />
              {/* Main left side */}
              <div className="col s4">
                <div className="row">
                  <div className="col s10 center">
                    {/* <img
                        style={{ marginLeft: "80px" }}
                        className="responsive-img materialboxed circle"
                        width="120px"
                        src={driver.image}
                        alt="profile_picture"
                      /> */}
                    <span className="flow-text center">12341234</span>
                  </div>
                  <div className="col s2">
                    <span>
                      <i className="fas fa-user-edit small"></i>
                      <span style={{ fontWeight: "bold" }}>EDIT</span>
                    </span>
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      })
    ) : (
      <div className="center">No Drivers yet</div>
    );
    return (
      <div className="container">
        <h4 className="center">Profile</h4>
        {driverList}
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    drivers: state.drivers
  };
};

export default connect(mapStateToProps)(DriverProfileG);
